import React from "react";

const JitsiFrame = ({ roomName }) => {
  return (
    <iframe
      title="Jitsi Meeting"
      src={`http://localhost:8080/${roomName}`}
      allow="camera; microphone; fullscreen; display-capture"
      style={{
        width: "100%",
        height: "600px",
        border: 0,
        borderRadius: "8px",
        marginTop: "16px",
      }}
    />
  );
};

export default JitsiFrame;
